package main

import (
	"fmt"
	"strings"
)

func main() {
	fmt.Println(solution(in))
}

func solution(data string) int {
	var min = len(data)

	for i := range 26 {
		newData := strings.ReplaceAll(data, string(byte(i+65)), "")
		newData = strings.ReplaceAll(newData, string(byte(i+97)), "")

		if len := react(newData); len < min {
			min = len
		}
	}

	return min
}

func react(data string) int{
	var diff = byte('a' - 'A')

	for {
		isDiff := false
		for i := range data {
			if i >= len(data)-1 {
				break
			}

			if data[i] == data[i+1]+diff || data[i] == data[i+1]-diff {
				data = strings.ReplaceAll(data, data[i:i+2], "")
				isDiff = true
			}

		}
		if !isDiff {
			return len(data)
		}
	}
}

